// import styled from 'styled-components';
import { motion } from 'framer-motion';
import "./opening.scss"


export const Opening = () => {
  return (
    <div className="Opening">
        <div className="bgContainer">
        </div>

        <div className="ball1">
          <img src="assets/ball1.png" alt="" />
        </div>

        <div className="ball2">
        <img src="assets/ball2.png" alt="" />


        </div>

        <div className="ball3">

        <img src="assets/ball3.png" alt="" />

        </div>
    </div>
  )
}



export default Opening;
